sourcesContent:
import { Router } from "express";
const router = Router();
import {
  createUser,
  getUsers,
  getOneUser,
  updateUser,
} from "../controllers/user.controller";

router.post("/register", createUser);
router.get("/", getUsers);

// un solo user
router.get("/:id_usuario", getOneUser);

//update
router.put("/:id_usuario", updateUser);
export default router;

