import _User from "../models/Users";

//Create
export async function createUser(req, res) {
  const { email, nombre, apellido, password } = req.body;
  try {
    let newUser = await _User.create(
      {
        email,
        nombre,
        apellido,
        password,
      },
      {
        fields: ["email", "nombre", "apellido", "password"],
      }
    );
    if (newUser) {
      return res.json({
        message: "Project created successfully",
        data: newUser,
      });
    }
  } catch (error) {
    console.log(error); //para observar el error
    res.status(500).json({
      message: "Algo ha salido mal",
      data: [],
    });
  }
}

//Get

export async function getUsers(req, res) {
  try {
    const usuarios = await _User.findAll();
    res.json({
      data: usuarios,
    });
  } catch (error) {
    console.log(error);
  }
}

// Get One User
export async function getOneUser(req, res) {
  try {
    const { id_usuario } = req.params;
    const usuario = await _User.findOne({
      where: {
        id_usuario: id_usuario,
      },
    });
    res.json(usuario);
  } catch (error) {
    console.log(error);
  }
}

export async function updateUser(req, res) {
  const { id_usuario } = req.params;
  const { email, nombre, apellido, headline, password, picture } = req.body;

  const usuarios = await _User.findAll({
    attibutes: ["nombre", "apellido", "password", "headline", "picture"],
    where: {
      id_usuario: id_usuario,
    },
  });

  if (usuarios.length > 0) {
    usuarios.forEach(async (usuario) => {
      await usuario.update({
        nombre,
        apellido,
        password,
        headline,
        picture,
      });
    });
  }
  return res.json({
    message: "Project Update Succesfully",
    data: usuarios,
  });
}

